import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import '../stylesheets/deletecar.css';

const DeleteCar = () => {
  const navigate = useNavigate();

  const [carName, setCarName] = useState('');
  const [carData, setCarData] = useState({
    Name: '',
    Type: '',
    Make: '',
    Price: 0,
    Image: '',
    Desc: '',
    Fuel: '',
    Year: '',
  });

  useEffect(() => {
    // Fetch car data based on 'carName' from the server and update state
    // Replace the URL with your API endpoint
    fetch(`/api/cars/${carName}`)
      .then((response) => response.json())
      .then((data) => setCarData(data[0])) // Assuming the server returns an array with one element
      .catch((error) => console.error('Error fetching car data:', error));
  }, [carName]);

  const handleDelete = () => {
    // Perform logic to delete the car data in the database
    // Replace the URL with your API endpoint
    fetch(`/api/cars/delete/${carData._id}`, {
      method: 'DELETE',
    })
      .then((response) => {
        if (response.ok) {
          console.log('Car deleted successfully');
          window.alert('Car deleted successfully!');
          navigate('/');
        } else {
          console.error('Error deleting car:', response.statusText);
        }
      })
      .catch((error) => console.error('Error deleting car:', error));
  };

  return (
    <div>
      <h2>Delete Car</h2>
      <div>
        <label>
          Enter Car Name:
          <input type="text" value={carName} onChange={(e) => setCarName(e.target.value)} />
        </label>
        <button onClick={handleDelete}>Search & Delete</button>
      </div>
      {carData._id && (
        <div>
          <p>Car Found:</p>
          <p>Name: {carData.Name}</p>
          <p>Type: {carData.Type}</p>
          <p>Make: {carData.Make}</p>
          <p>Price: {carData.Price}</p>
          <p>Image: {carData.Image}</p>
          <p>Description: {carData.Desc}</p>
          <p>Fuel: {carData.Fuel}</p>
          <p>Year: {carData.Year}</p>
          <button onClick={handleDelete}>Delete</button>
        </div>
      )}
    </div>
  );
};

export default DeleteCar;
